import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ShoppingCart, User } from 'lucide-react';


// Import UI Components
import { Button } from './components/ui/button';
import { Input } from './components/ui/input';
import { Label } from './components/ui/label';
import { Card } from './components/ui/card';

// Import Common Components
import CartIcon from './components/common/CartIcon';
import CategoryCard from './components/common/CategoryCard';
import Filter from './components/common/Filter';
import Footer from './components/common/Footer';
import Header from './components/common/Header';
import Pagination from './components/common/Pagination';
import ProductCard from './components/common/ProductCard';
import SearchBar from './components/common/SearchBar';

// Import Emergency Components
import EmergencyCheckout from './components/emergency/EmergencyCheckout';
import EmergencyProductList from './components/emergency/EmergencyProductList';
import EmergencyTracker from './components/emergency/EmergencyTracker';

// Import Regular Components
import RegularCheckout from './components/regular/RegularCheckout';
import RegularProductList from './components/regular/RegularProductList';

// Import Pages
import CartPage from './pages/CartPage';
import CategoryPage from './pages/CategoryPage';
import EmergencyCheckoutPage from './pages/EmergencyCheckoutPage';
import EmergencyProductPage from './pages/EmergencyProductPage';
import HomePage from './pages/HomePage';
import OrderConfirmationPage from './pages/OrderConfirmationPage';
import RegularCheckoutPage from './pages/RegularCheckoutPage';
import RegularProductPage from './pages/RegularProductPage';
import SubscriptionPage from './pages/SubscriptionPage';
import UserProfilePage from './pages/UserProfilePage';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/HomePage';

// Protected Route Component


// Main App Layout Component
const AppLayout = () => {
  const { user, logout } = useAuth();

  return (
    <div className="min-h-screen bg-gray-50 flex flex-col">
      <Header />
      <main className="flex-grow container mx-auto px-4 py-8">
        <Routes>
          {/* Public Routes */}
          <Route path="/" element={<HomePage />} />
          <Route path="/categories" element={<CategoryPage />} />
          <Route path="/products" element={<RegularProductList />} />
          <Route path="/product/:id" element={<RegularProductPage />} />
          <Route path="/emergency-products" element={<EmergencyProductList />} />
          <Route path="/emergency-product/:id" element={<EmergencyProductPage />} />
          
          {/* Protected Routes */}
          <Route
            path="/cart"
            element={
              <ProtectedRoute>
                <CartPage />
              </ProtectedRoute>
            }
          />
          <Route
            path="/checkout"
            element={
              <ProtectedRoute>
                <RegularCheckoutPage>
                  <RegularCheckout />
                </RegularCheckoutPage>
              </ProtectedRoute>
            }
          />
          <Route
            path="/emergency-checkout"
            element={
              <ProtectedRoute>
                <EmergencyCheckoutPage>
                  <EmergencyCheckout />
                  <EmergencyTracker />
                </EmergencyCheckoutPage>
              </ProtectedRoute>
            }
          />
          <Route
            path="/order-confirmation"
            element={
              <ProtectedRoute>
                <OrderConfirmationPage />
              </ProtectedRoute>
            }
          />
          <Route
            path="/profile"
            element={
              <ProtectedRoute>
                <UserProfilePage />
              </ProtectedRoute>
            }
          />
          <Route
            path="/subscription"
            element={
              <ProtectedRoute>
                <SubscriptionPage />
              </ProtectedRoute>
            }
          />
        </Routes>
      </main>
      <Footer />
    </div>
  );
};


export default App;
